import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-f1e7afee.js";const o={},c=t("<p>《三命通会》卷 九·六辛日辛卯时断</p><p>六辛日生时辛卯，妻子难为遇比肩；</p><p>秋产冬生贫下格，丙临寅马却当权。</p><p>辛日辛卯时，比肩分财。</p><p>辛以乙为财，卯上乙旺，遇比分夺，损伤妻子。</p><p>生秋冬，财官无气，平常。</p><p>寅巳午月，干透丙火，丙合辛生，官贵显达。</p><p>辛卯，悬针煞，柱多不吉。</p><p>辛丑日辛卯时，春、夏生土厚地方，富贵。</p><p>秋，克妻刑子。</p><p>冬、艰辛。</p><p>寅巳午月，近待，贵。</p><p>甲戌年月、木火运，风宪。</p><p>辛卯日辛卯时，寅午戌月，财官双美，贵显。</p><p>卯酉申辰年月，近侍，贵；见官印财星，妙。</p><p>一云先苦，中年大发。</p><p>辛巳日辛卯时，春，财旺；夏、官旺、秋，身强；冬，懦弱。</p><p>巳酉年月，行木火运，贵戚。</p><p>申月、水火运，金紫。</p><p>巳月、西北运，风宪。</p><p>辛未日辛卯时，纯未、丁年月，虽大权贵，不善终。</p><p>寅巳亥，纯吉。</p><p>辛酉日辛卯时，出身孤苦，中年获福，末年封妻荫子，贵。</p><p>巳月，官印逢天德，贵当一品。</p><p>丑月、木火运、中贵。</p><p>申酉亥年月，东南运，风宪。</p><p>辛亥日辛卯时，春夏，财官双美，贵显。</p><p>秋冬，背禄逐马、劳碌反复。</p><p>纯亥，金水氵亟秀，多发高科。</p><p>辰戌，吉。</p><p>丑未，尤吉。</p><p>六辛遇卯禄分明，比劫逢财事不成；春夏人生财禄旺，秋冬刑害命中平。</p><p>辛日时逢辛卯，二辛分夺妻财。</p><p>雁行鸳侣少合谐，独立自成无碍。</p><p>年月财星生旺，忻然禄自天来。</p><p>运行比劫事沈埋，木火运中通泰。</p>",36),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","254卷 九·六辛日辛卯时断.html.vue"]]);export{f as default};
